const { render } = require("@testing-library/react");

function navBar() {
    const items = [{name: "Home", id: "Body"}, 
                    {name: "Education", id: "Education"}, 
                    {name: "Experience", id: "Experience"}, 
                    {name: "Projects", id: "Projects"}];
    return (
        <div>
            <ul id = "nav" style={navCSS}>
                {items.map(item => (
                    <li style={navItemCSS} key={item}><a href={'#'+item.id}>{item.name}</a></li>
                ))}
            </ul>
        </div>
    )
}

const navCSS = {
    width: "100%",
    margin: "0 0 3px 0",
    display: "flex",
    flexDirection: "row",
    color: "red"
}

const navItemCSS = {
    display: "block",
    margin: "10px",
    fontSize: "20px",
    textColor: "blue"
}

export default navBar;
